import React from "react";
import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
import Home from "./routes/Home";
import Detail from "./routes/Detail";

const App = () => {
  return (
    <Routes>
      <Route path="/" component={Home}></Route>
      <Route path="/:id" component={Detail}></Route>
    </Routes>
  );
};

export default App;
